import styled from "styled-components";

const CardContent = styled.div`
  margin: 1rem;
  margin-top: 0.3rem;

  h3 {
    margin-bottom: 0.5rem;
    text-align: center;
    font-size: 1.2rem;
  }
`;

export default CardContent;
